import './App.css';
import Radar from './components/Radar/Radar';
import RulerRightLeft from './components/Ruler/RulerRightLeft';
import RulerTopBottom from './components/Ruler/RulerTopBottom';

function App() {
  return (
    <div className="App">
      <nav>
        <main>
          <div className={classes.line360To180}></div>
          <div className={classes.line90To270}></div>

        <div className="square">
          <RulerTopBottom />
          <Radar />
          <RulerRightLeft />
        </div>
      </main>

      <aside></aside>
    </nav>

    </div >
  );
}

export default App;
